  false,\n\t\"url\": null,\n\t\"notes\": \"The 2006 Second Edition TIGER/Line files
  are an extract of selected geographicnttttand cartographic information from the
  Census TIGER database. The geographic coveragenttttfor a single TIGER/Line file
  is a county or statistical equivalent entity, with thenttttcoverage area based on
  the latest available governmental unit boundaries. The CensusnttttTIGER database
  represents a seamless national file with no overlaps or gaps betweennttttparts.
  However, each county-based TIGER/Line file is designed to stand alone as annttttindependent
  data set or the files can be combined to cover the whole Nation. Thentttt2006 Second
  Edition TIGER/Line files consist of line segments representing physicalnttttfeatures
